import React, { useEffect } from 'react'
import { connect } from 'react-redux'
import Nav from '../components/Nav'
import HomePanel from '../components/HomePanel'


const Home = () => {
 
  return (
    <>
     <Nav />
     <HomePanel />
    </>
  )
}

function mapStateToProps({ authedUser }) {
  return {
    authedUser
  }
}

export default Home
